    console.log(self.ctx.settings.highlights)
    var markers = "gray";

    var $scope = self.ctx.$scope;
    var minValue = parseInt(self.ctx.settings.minValue)
    var maxValue = parseInt(self.ctx.settings.maxValue)
    $scope.color1 = self.ctx.settings.color1;
    var data = String(self.ctx.data[0].data[0]).split(
