    //var data2 = self.ctx.data;
    var data1 = parseInt(data[1])

    for (var key in self.ctx.settings.highlights) {
        console.log(self.ctx.settings.highlights[key]
            .from)
        console.log(self.ctx.settings.highlights[key]
            .to)
        if (self.ctx.settings.highlights[key].from <
