            .to > data1) {
            markers = self.ctx.settings.highlights[key]
                .color
            console.log(markers)
        }
    }

    var chart = JSC.chart('chartDiv9', {
        debug: true,
        defaultSeries_type: 'gauge',
        legend: {
            position: 'inside top',
            boxVisible: false,
            visible: false
