descriptor.controllerScript:
self.onInit = function() {
    var cssParser = new cssjs();
    cssParser.testMode = false;
    var namespace = 'button-card-' + hashCode(self.ctx
        .settings.buttonCss);
    cssParser.cssPreviewNamespace = namespace;
    cssParser.createStyleElement(namespace, self.ctx
        .settings.buttonCss);
    self.ctx.$container.addClass(namespace);
    var $scope = self.ctx.$scope;
    self.defaultColor = self.ctx.settings.defaultColor;
    self.defaultText = self.ctx.settings.buttonText;
    self.hoverColor = tinycolor(self.ctx.settings.defaultColor).lighten(10).toHexString();
    $scope.color1 = self.ctx.settings.color1;
    $scope.color2 = self.ctx.settings.color2;
    $scope.color3 = self.ctx.settings.color3;
    $scope.buttonLabel = self.ctx.settings.buttonLabel;
    $scope.buttonLabel2 = self.ctx.settings.buttonLabel2;
    $scope.onMouseOver = function() {
        $scope.buttonColor = self.hoverColor;

    };
    $scope.onMouseLeave = function() {
        $scope.buttonColor = self.defaultColor;
    };

    function hashCode(str) {
        var hash = 0;
        var i, char;
        if (str.length === 0) return hash;
        for (i = 0; i < str.length; i++) {
            char = str.charCodeAt(i);
            hash = ((hash << 5) - hash) + char;
            hash = hash & hash;
        }
        return hash;
    }

    self.ctx.$scope.sendStart = function(){
      console.log("clicked");  
    }
    self.ctx.$scope.sendStop= function(){
        console.log("stopped");
    }
}

